import React from "react";
import { Card } from "react-bootstrap";
const CompanyCard = (props) => {
  return (
    <Card>
      <Card.Body>
        <Card.Title>{props.role}</Card.Title>
        <Card.Subtitle className="mb-2 text-muted">Google</Card.Subtitle>
      </Card.Body>
    </Card>
  );
};

export default CompanyCard;
